                return new Tuple2<>(arr[0], 1);
            }
        }).reduceByKey(Integer::sum);

        JavaPairRDD<String, Integer> onsiteDataWithHitCount = onsiteDataWithCount.leftOuterJoin(topFrequentQueries.mapToPair(new PairFunction<String, String, Integer>() {
