struct ASTNode {
    let type: NodeType
    var children: [ASTNode] = []
    var value: String?
}

// Expression node
struct ExpressionNode: ASTNode {
    let type: NodeType = .expression
    var value: String?
    var children: [ASTNode] = []
}

